  true,\n\t\"url\": null,\n\t\"notes\": \"The NAIP 2015 Imagery Feedback web application
  allows users to make comments and observations about the quality of the 2015 National
  Agriculture Imagery Program (NAIP) acquisition. The feedback obtained from this
  map will be reviewed by APFO staff and considered both for the current year imagery
  and future updates. The feedback provided by users will help to improve the NAIP
  imagery program. To provide feedback follow these steps: Click the \"Add Observation\"
  button on the left side of the map A template with feature symbols will open (occasionally
  you may need to click again to bring up the feature templates) Click on either the
  point, polygon, or comment symbol in the editing template on the left side of the
  map Then zoom in and click on the imagery at the location of your observation/feature
  To comment on another user's observations please use the orange map pin symbol If
  you are testing or make a mistake please note this in the comments section or delete
  the feature Fill in the attribute information and comments for the added feature
  To attach an image or file with a feature, click the browse button in the attachments
  section and then choose the file from your computer to upload File size up to 10MB
  File types: DOC, DOCX, GIF, IMG, JP2, JPEG, PDF, TXT, XML, and ZIP\",\n\t\"license_title\":
